import React from "react";

import classes from "./TwitsList.module.css";
import Content from "../Layout/Content";

const TwitsList = () => {
  return (
    <Content>
      <ul className={classes.twits__list}>
        <li className={classes.twit_post}>
          <div>
            <img
              src="./img/user.png"
              alt="Account avatar"
              className={classes.user__avatar}
            />
          </div>
          <div className={classes.twit__text_content}>
            <div className={classes.twit__post_info}>
              <span className={classes.twitter__name}>Ivan Perzhu </span>
              <span className={classes.twitter__handle}>@perdezh</span>
              <span className={classes.twitter__handle}> &bull; 4 h</span>
            </div>
            <div className={classes.twit__post_content}>
              Many of life's failures are people who did not realize how close
              they were to success when they gave up.
            </div>
          </div>
        </li>
      </ul>
    </Content>
  );
};

export default TwitsList;
